function create_agents(old_agents) //top agents = array
{
  if(old_agents != null)
  {
      let best_agent_1 = 0
      let best_agent_2 = 1

    for(let i = 0; i < old_agents.length; i++)
    {
      if(max(old_agents[i].episode_checkpoints) > max(old_agents[best_agent_1].episode_checkpoints))
      {
        best_agent_1 = i
        if(best_agent_2 == i){best_agent_2 = 0}
      }
      else if(max(old_agents[i].episode_checkpoints) > max(old_agents[best_agent_2].episode_checkpoints))
      {
        best_agent_2 = i
      }
    }

    print('best agent 1: ' + best_agent_1 + ', best agent 2: ' + best_agent_2)
    const q_div = 10 / season_num //constrain(10 / season_num, 0.8, 1000)

    let new_q_table = []
    for(let state_index = 0; state_index < best_agent_1.num_states; state_index++)
        {
            let current_arr = []
            for(let action_index = 0; action_index < best_agent_1.num_actions; action_index++)
            {
                current_arr.push((best_agent_1[state_index][action_index] + 
                                  best_agent_2[state_index][action_index]) / q_div)
            }
            new_q_table.push(current_arr)
        }

    let new_agents = []

    old_agents[best_agent_1].agent_parameters['epsilon'] = 0.75
    old_agents[best_agent_2].agent_parameters['epsilon'] = 0.75

    new_agents.push(old_agents[best_agent_1])
    new_agents.push(old_agents[best_agent_2])
    
    for(let i = 0; i < num_agents - 2; i++)
    {
      agent_car = new Car(
        position = createVector(start_pos.x, start_pos.y),
        config = {
         sz: createVector(80, 45),
         wheelSize: createVector(14, 10),
         bodyColor: color(random(0,255), random(0,255), random(0,255)),
         speed: 0.9,
         maxSpeed: 8.5,
         steerSpeed: 3.5,
         drag: 0.98,
         numRays: 5,
         rayLength: 280,
        }
       )
  
       new_agent = new Agent(
        agent_parameters = {
          'name': names[int(random(0,names.length))],
          'gamma': random(0.5,0.95) + old_agents[best_agent_1].agent_parameters['gamma'] / 2,
          'alpha': random(0.05,0.3) + old_agents[best_agent_1].agent_parameters['alpha'] / 2,
          'epsilon': 1,
          'epsilon_decay': random(0.88,0.985),
          'learning_type': 'SARSA'
          },
        max_steps = max_steps,
        car = agent_car
      )
  
      new_agent.reset(-1, start_angle)
      new_agent.set_checkpoints(checkpoints)
        
      arrayCopy(new_q_table, new_agent.q_table)

      new_agents.push(new_agent)
    }
    agents = new_agents
  }
  else
  {
    for(let i = 0; i < num_agents; i++)
    {
      agent_car = new Car(
        position = createVector(start_pos.x, start_pos.y),
        config = {
         sz: createVector(80, 45),
         wheelSize: createVector(14, 10),
         bodyColor: color(random(0,255), random(0,255), random(0,255)),
         speed: 0.9,
         maxSpeed: 8.5,
         steerSpeed: 3.5,
         drag: 0.98,
         numRays: 5,
         rayLength: 280,
        }
      )

      new_agent = new Agent(
        agent_parameters = {
        'name': names[int(random(0,names.length))],
        'gamma': random(0.5,0.95),
        'alpha': random(0.05,0.3),
        'epsilon': 1,
        'epsilon_decay': random(0.88,0.985),
        'learning_type': 'SARSA'
        }, 
        max_steps = max_steps,
        car = agent_car
      )

      new_agent.reset(-1, start_angle)
      new_agent.set_checkpoints(checkpoints)

      agents.push(new_agent)
    }
  }
}
